import React from "react";
import { Text, Grid } from "./index";
const Input = (props) => {
  const { labal, placeholder, _onChange } = props;
  return (
    <React.Fragment>
      <Text margin="0px">{labal}</Text>
      <input placeholder={placeholder} onChange={_onChange} />
    </React.Fragment>
  );
};
Input.defaultProps = {
  labal: "텍스트",
  placeholder: "텍스트를 입력해주세요",
  _onChange: () => {},
};

export default Input;
